import logo from './logo.svg';
import './App.css';

function Details() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-laaaaogo" alt="logo" />
        <p>
          aaaaaaaaaaaaaaaaaaaaaaaaaaaa
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Details;
